insert into coffee_test values(1,'못참아파','그래도 커피는 못참아파','카페인에 민감해도 커피는 참을 수 없죠. 디카페인 커피를 선호하는 당신은 세심하고 꼼꼼한 스타일이에요.', 1,'디카페인커피','못참아파','https://d227tph7fpseou.cloudfront.net/static/quizzes/result/Decaf.png');
insert into coffee_test values(2,'개성파','스스로 빛나는 개성파','화사하고 산뜻한 향이 가득한 개성파! 원두가 뽐내는 개성을 또렷하게 즐겨요. 독특한 개성을 가질수록 더 사랑에 빠져요',4,'싱글오리진','순정파','https://d227tph7fpseou.cloudfront.net/static/quizzes/result/Romantic.png');
insert into coffee_test values(3,'순정파','한 가지를 오롯이 즐기는 순정파','한 잔에 한 가지의 맛을 즐기는 당신, 순수한 취향을 가지셨네요! 선명한 맛에서 오는 순수함을 싱글 오리진 커피로 느낄 수 있어요.',4,'싱글오리진','모험파','https://d227tph7fpseou.cloudfront.net/static/quizzes/result/Pure.png');
insert into coffee_test values(4,'낭만파','부드러운 라떼 한 잔 낭만파','고소하고 부드러운 우유를 곁들여 마시는 낭만파! 라떼를 좋아하는 사람은 주변 사람들을 편하고 즐겁게 해요.',10,'고소하고 쌉싸름한 커피','정통파','https://d227tph7fpseou.cloudfront.net/static/quizzes/result/Romantic.png');
insert into coffee_test values(5,'정통파','고소하고 맛있는 커피 다운 커피 정통파','커피의 고소한 맛과 편안함을 좋아하는 당신! 커피 다운 커피는 여러 사람들과 함께 즐기기에 좋아요.',2,'블렌드','대담파','https://d227tph7fpseou.cloudfront.net/static/quizzes/result/Familiarity.png');
insert into coffee_test values(6,'모험파','새로운 도전을 멈추지 않는 모험파','커피가 어디서 왔는지 호기심이 가득하고,  색다른 맛에 거부감이 없는 모험파! 독특한 맛을 그대로 즐기는 도전 정신이 뛰어나요. 산지마다 개성이 가득한 맛을 좋아해요.',4,'싱글오리진','개성파','https://d227tph7fpseou.cloudfront.net/static/quizzes/result/Adventure.png');
insert into coffee_test values(7,'대담파','쌉사름함을 즐기는 대담파','커피가 주는 묵직함과 풍부함을 여유롭게 즐기는 대담파! 강렬함이 어울리는 당신은 용기 있고 대담한 취향의 소유자예요.',2,'블렌드','낭만파','https://d227tph7fpseou.cloudfront.net/static/quizzes/result/Boldness.png');
insert into coffee_test values(8,'균형파','서로의 조화가 중요한 균형파','서로의 단점을 잘 보완하며 어우러지는 균형파! 커피의 향미가 톡톡 튀기보단 묵직하고 탄탄함을 좋아해요.',11,'균형감있는원두','깔끔파','https://d227tph7fpseou.cloudfront.net/static/quizzes/result/Balance.png');
insert into coffee_test values(9,'깔끔파','군더더기 없이 즐기는 깔끔파','-',0,'-','-','https://d227tph7fpseou.cloudfront.net/static/quizzes/result/Clean.png');
