insert into coffee_match values(1,'디카페인','디카페인 커피는 카페인을 제거하는 방식에 따라 남아있는 카페인 햠량이 달라져요. 일반적으로 약 90%의 카페인이 제거되고, 일반 원두와 비교해 10분의 1정도의 카페인 함량이 남아있는 셈이에요. 대부분 물, 유기 용제 또는 이산화탄소를 이용해 용매로 세척하는 방식으로 디카페인 커피가 만들어져요.');
insert into coffee_match values(2,'블렌드','블렌딩 된 원두를 추천해요. 서로 다른 개성의 원두가 로스팅을 통해 새롭게 만들어진 블렌딩은 개별 원두가 가지고 있는 약점을 보완하여 균형감있는 맛을 만들어내요. 단일 원두에서 맛볼 수 없는 로스터리만의 특별하고 개성있는 맛을 즐길 수도 있어요.');
insert into coffee_match values(3,'미디엄다크','미디엄~다크 로스팅 된 원두를 추천해요. 강렬하고 묵직하며 풍부한 느낌을 즐길 수 있어요. 다크 초콜릿의 쌉싸름한 맛이나 고소한 견과류의 향 등을 즐길 수도 있어요. 강한 로스팅은 단맛과 바디감을 강조하고 산미는 줄입니다. 우유나 크림과도 잘 어울리는 편이에요.');
insert into coffee_match values(4,'싱글오리진','싱글 오리진 원두를 추천해요. 싱글 오리진 커피는 품질이 좋은 순수한 하나의 원두를 통해 만들어져요. 산지, 품종, 정제방식에 따라 개성있는 향미를 즐길 수 있어요. 특별하고 다채로운 커피를 즐기고 싶다면 좋은 선택이에요.');
insert into coffee_match values(5,'쌉싸름한 커피','우유와 함께할 때, 더 빛나는 커피가 있어요. 초콜릿, 캐러멜, 견과류 느낌의 고소하고 달콤쌉싸름한 커피가 유제품과 잘 어울릴 수 있어요.일반적으로 다크한 커피의 강렬함은 우유와 조화를 잘 이뤄 누구나 좋아하지만, 가볍고 산미가 있는 커피는 우유와 섞였을 때 사람들에게 호불호가 있는 경향이 있습니다.');
insert into coffee_match values(6,'라이트미디엄로스팅','라이트~미디엄 로스팅 된 원두를 추천해요. 원두를 약하게 볶아 원두 고유의 다채롭고 미묘한 맛을 즐길 수 있어요. 주로 산미가 있는 편으로 상큼하고 달콤한 과일이나 꽃향, 그 외에도 다양한 향미를 즐기기에 좋아요. 산지에 따라 독특하고 흥미로운 맛을 즐길 수 있습니다.');
insert into coffee_match values(7,'워시드 프로세싱','워시드(습식)로 정제된 원두를 추천해요. 커피 열매의 과육을 깨끗하게 제거하고 건조해요. 비교적 높은 산미, 가벼운 바디감을 느낄 수 있어요. 화사한 꽃향기와 과일향 등 원두 그 자체의 깔끔하고 산뜻한 맛을 즐길 수 있습니다.');
insert into coffee_match values(8,'내추럴 프로세싱','내추럴(건식)로 정제된 원두를 추천해요. 커피 열매의 과육을 제거하지 않고 건조시켜요. 씨앗을 둘러싼 과육으로부터 다양한 향미를 흡수해요. 좋은 내추럴 커피는 농후한 바디감과 달콤한 과일 맛을 강하게 느낄 수 있어요. 산지의 특색을 다채롭게 즐길 수 있어요.');
insert into coffee_match values(9,'미디엄 로스팅','미디엄 로스팅 된 원두를 추천해요. 원두가 가진 다채로운 맛과 로스팅 시 만들어지는 단맛이 균형잡혀 있어요. 상큼하고 달콤한 과일의 느낌과 카라멜, 밀크초콜릿 같은 달콤쌉싸름한 맛을 균형감 있게 즐길 수 있어요. 약간의 산미와 적당한 바디감이 있어요.');
insert into coffee_match values(10,'고소하고 쌉싸름한 커피','우유와 함께할 때, 더 빛나는 커피가 있어요. 초콜릿, 캐러멜, 견과류 느낌의 고소하고 달콤쌉싸름한 커피가 유제품과 잘 어울릴 수 있어요. 일반적으로 다크한 커피의 강렬함은 우유와 조화를 잘 이뤄 누구나 좋아하지만, 가볍고 산미가 있는 커피는 우유와 섞였을 때 사람들에게 호불호가 있는 경향이 있습니다.');
insert into coffee_match values(11,'균형감있는원두','에스프레소를 마신다면, 균형감 있는 원두를 고르는 것이 중요해요. 에스프레소는 다른 커피에 비해 산미가 도드라지고, 강렬한 풍미가 부담스러울 수 있기 때문이에요. 코케에서는 각 로스터리의 개성을 살리면서도 균형감이 뛰어난 에스프레소용 원두를 제공해요.');
